import React from "react";

const NFT = () => {
  return (
    <div>
      <div class="card bg-blur">
        <h1>Go to the future and sell NFT's</h1>

        <a className="btn btn-gradient-border btn-glow" href={"google.com"}>
          Go To Market Place
        </a>
      </div>
    </div>
  );
};

export default NFT;
